import React, {useState, useEffect} from 'react';
import CSGO from './Images/CSGO.png';
import './Games.css';
import axios from 'axios';


function Games() {
    const [data, setData] = useState([]);


    const fetchAPI = async() => {
      var stringGames;
      var stringReviews;
      var stringPrices;
      const response = await axios.get("http://127.0.0.1:8080/api/members");
      setData(response.data.games);
      stringGames = String(response.data.games);
      stringReviews = String(response.data.reviewScores);
      stringPrices = String(response.data.prices);

      const array = stringGames.split(/\s(?=")/);
      console.log(array[0]);
    };


    //Somewhere around here we need to parse through the strings,
    //remove quotes whenever we find them (as well as []'s), but also
    //use quotes as identifiers for the beginning and end of a string to use.


  
    useEffect(() => {
      fetchAPI()
    }, []);

  return (
    <div className = "games">
        <div className = "row-games">
            <div className = "Games-Middle">
                <img
                    src = {CSGO}
                    alt = ""
                />
            </div>
            <br />
            <div className = "Games-Middle">
                <p>Title</p>
                <p>
                {
                    data.map((games, index) => (
                        <>
                        <span key={index}>{games[2]}</span>
                        </>
                    ))
                }
                </p>
            </div>
            <div className = "Games-Middle">
                <p>Steam Rating</p>
            </div>
            <div className = "Games-Middle">
                <p> Price</p>
            </div>
            <br />
            <div className = "Games-Middle">
                <div className = "Games-Button">
                    <button  onClick = "addGame">
                        
                    </button>
                </div>
            </div>
        </div>
        <div className = "row-games">
            <div className = "Games-Middle">
                <img
                    src = {CSGO}
                    alt = ""
                />
            </div>
            <br />
            <div className = "Games-Middle">
                <p>Title</p>
            </div>
            <div className = "Games-Middle">
                <p>Steam Rating</p>
            </div>
            <div className = "Games-Middle">
                <p> Price</p>
            </div>
            <br />
            <div className = "Games-Middle">
                <div className = "Games-Button">
                    <button  onClick = "addGame">
                        
                    </button>
                </div>
            </div>
        </div>
        <div className = "row-games">
            <div className = "Games-Middle">
                <img
                    src = {CSGO}
                    alt = ""
                />
            </div>
            <br />
            <div className = "Games-Middle">
                <p>Title</p>
            </div>
            <div className = "Games-Middle">
                <p>Steam Rating</p>
            </div>
            <div className = "Games-Middle">
                <p> Price</p>
            </div>
            <br />
            <div className = "Games-Middle">
                <div className = "Games-Button">
                    <button  onClick = "addGame">

                    </button>
                </div>
            </div>
        </div>
    </div>
  );
}

export default Games;
